    <section class="sect2 glow-yellow js_sect2">
        <div class="container">
            <ul>
                <li class="item">
                    <span class="num">/01</span>
                    <p class="title">42 компьютера</p>
                    <p class="text">34 Premium / 6 VIP / 2 Super VIP</p>
                </li>
                <li class="item">
                    <span class="num">/02</span>
                    <p class="title">Держатель трубки <br/>для кальяна</p>
                    <p class="text">Только у нас ты можешь курить кальян без рук, <br/>не отвлекаясь от игры </p>
                </li>
                <li class="item">
                    <span class="num">/03</span>
                    <p class="title">Мониторы закреплены к стене</p>
                    <p class="text">Регулируй его как тебе удобно, имея полную свободу для рук</p>
                </li>
                <li class="item">
                    <span class="num">/04</span>
                    <p class="title">Уникальные столы</p>
                    <p class="text">Отсутствие ножек и невероятно широкие</p>
                </li>
                <li class="item">
                    <span class="num">/05</span>
                    <p class="title">Бар / лаунж / <br/>luxe room</p>
                    <p class="text">Насладись лимонадами и коктейлями от <br/>нашего бармена в лаунж зоне, либо VIP
                        комнате</p>
                </li>
                <li class="item">
                    <span class="num">/06</span>
                    <p class="title">Кухня</p>
                    <p class="text">Наш бренд-шеф прошёл стажировку в 2-х мишленовских ресторанах, обязательно попробуй
                        его блюда</p>
                </li>
            </ul>
        </div>
    </section>

